ÄÐZ<?php exit; ?>a:6:{s:10:"last_error";s:0:"";s:10:"last_query";s:192:"SELECT   wpw6_posts.* FROM wpw6_posts  WHERE 1=1  AND wpw6_posts.post_name = 'top-11-strikers-2018-fifa-world-cup-russia' AND wpw6_posts.post_type = 'post'  ORDER BY wpw6_posts.post_date DESC ";s:11:"last_result";a:1:{i:0;O:8:"stdClass":23:{s:2:"ID";s:3:"592";s:11:"post_author";s:1:"1";s:9:"post_date";s:19:"2017-12-24 22:06:26";s:13:"post_date_gmt";s:19:"2017-12-24 16:21:26";s:12:"post_content";s:12483:"<p style="text-align: justify;">Upcoming FIFA World Cup 2018 Russia is a great platform for all the strikers of the qualified country. Every player dream of better and successful international career during his journey and wikiceleb has sort listed the best striker that is going to perform and has that potential to be the best of the best in 2018 FIFA World Cup Russia. Thus, our Top 11 strikers in 2018 FIFA World Cup Russia are:</p>
1.<strong style="font-size: 16px;">Robert Lewandowski</strong>

<img class="aligncenter wp-image-595" src="http://wikiceleb.com/wp-content/uploads/2017/12/Robert-Lewandowski-300x168.jpg" alt="" width="534" height="299" />

Full Name: Robert Lewandowski

Birth Date: 21 August 1988

Age: 29

Nation: Poland

Current Club: FC Bayern Munich
<p style="text-align: justify;">Polish striker Robert Lewandowski who plays for German club FC Bayern Munich is one of the most influential strikers in world football. He also captains his national team Poland who is going to participate in 2018 FIFA world cup Russia. He has 91 international caps for Poland with 51 goals. He is one of the top strikers to be watched in upcoming FIFA world cup.</p>
2.<strong style="font-size: 16px;">Harry Kane</strong>

<img class="aligncenter wp-image-596" src="http://wikiceleb.com/wp-content/uploads/2017/12/Harry-Kane-300x212.jpg" alt="" width="549" height="388" />

Full Name: Harry Edward Kane

Birth Date: 28 July 1993

Age: 24

Nation: <a href="http://wikiceleb.com/england-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">England</a>

Current Club: Tottenham Hotspur
<p style="text-align: justify;">Harry Kane is regarded as one of the best strikers in English Premier League. He has always scored 20+ goals in past 3 seasons for Tottenham and also shining currently with his good goal scoring capacity. Due to his poaching quality, he has been linked with giants like Real Madrid several times. He also has captained his national side England and has 23 international caps with 12 goals. He is the most valuable striker for England in upcoming FIFA world cup.</p>
3.<strong>Luis Suarez</strong>

<img class="aligncenter wp-image-597" src="http://wikiceleb.com/wp-content/uploads/2017/12/luis-300x200.jpg" alt="" width="535" height="356" />

Full Name: Luis Alberto Suarez Diaz

Birth Date: 24 January 1987

Age: 30

Nation: <a href="http://wikiceleb.com/uruguay-road-russia-world-cup-2018/" target="_blank" rel="noopener">Uruguay</a>

Current Club: FC Barcelona
<p style="text-align: justify;">Luis Suarez is one of the deadliest strikers in the world who had a great role in winning the treble and many other cups for FC Barcelona. He is the main front man for Barcelona and has a good pairing with Lionel Messi. He has 95 international caps for his national side Uruguay with 49 goals which is very good goal scoring ratio. He will main man to lead <a href="http://wikiceleb.com/uruguay-road-russia-world-cup-2018/" target="_blank" rel="noopener">Uruguay</a> in coming FIFA world cup and will be the top striker to be watched.</p>
4.<strong>Morata</strong>

<img class="aligncenter wp-image-598" src="http://wikiceleb.com/wp-content/uploads/2017/12/morata-1-300x200.jpg" alt="" width="559" height="372" />

Full Name: Alvaro Borja Morata Martin

Birth Date: 23 October 1992

Age: 25

Nation: <a href="http://wikiceleb.com/spain-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Spain</a>

Current Club: Chelsea FC
<p style="text-align: justify;">As <a href="http://wikiceleb.com/spain-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Spain</a> is one of the well-known, beloved and a top nation for FIFA world cup, it is also considered as one of the favored nation to win this FIFA world cup competition. For this great nation, Morata is their best striker who has goal poaching capability with many skills. He has 23 international caps with 13 goals. As <a href="http://wikiceleb.com/spain-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Spain</a> is one of the most watched sides in FIFA world cup, Morata has great responsibility for his national side in this competition.</p>
5.<strong>Mauro Icardi</strong>

<img class="aligncenter wp-image-599" src="http://wikiceleb.com/wp-content/uploads/2017/12/Mauro-Icardi-300x197.jpg" alt="" width="545" height="358" />

Full Name: Mauro Emanuel Icardi

Birth Date: 19 February 1993

Age: 24

Nation: <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a>

Current Club: Inter Milan
<p style="text-align: justify;">In the current scenario of world football, Icardi has best goal scoring ratio for his club Inter Milan. Not only in Serie-A but also in whole Europe, he is one of the best strikers who is playing his best football of his career. Although he has not got many chances to play for his national side <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a> due to the likes of Higuain, Aguero and other forwards, he will be given the main role to shine for upcoming FIFA world cup. He only has 4 international caps and has not found goal yet but surely he is going to be a brighter side for <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a> if given chance in FIFA world cup.</p>
6.<strong>Edinson Cavani</strong>

<img class="aligncenter wp-image-600" src="http://wikiceleb.com/wp-content/uploads/2017/12/cavani-300x208.jpg" alt="" width="534" height="370" />

Full Name: Edinson Roberto Cavani Gomez

Birth Date: 14 February 1987

Age: 30

Nation: <a href="http://wikiceleb.com/uruguay-road-russia-world-cup-2018/" target="_blank" rel="noopener">Uruguay</a>

Current Club: Paris Saint-Germain
<p style="text-align: justify;">Edinson Cavani is the main striker for well-known French Club Paris Saint-Germain who plays along with worldâ€™s most expensive Brazilian forward Neymar. Although Luis Suarez is considered to be the main striker for <a href="http://wikiceleb.com/uruguay-road-russia-world-cup-2018/" target="_blank" rel="noopener">Uruguay</a> but for upcoming FIFA world cup, he is surely going to partner with Suarez due to his recent form and goal scoring performances. He always finds a net in almost every game for PSG this season. This powerful striker has 98 international caps with 40 goals. He will be one of the watched strikers in upcoming FIFA world cup.</p>
7.<strong>Alexandre Lacazatte</strong>

<img class="aligncenter wp-image-602" src="http://wikiceleb.com/wp-content/uploads/2017/12/alex-1-300x189.jpg" alt="" width="550" height="347" />

Full Name: Alexandre Lacazatte

Birth Date: 28 May 1991

Age: 26

Nation: <a href="http://wikiceleb.com/france-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">France</a>

Current Club: Arsenal
<p style="text-align: justify;">French frontman Lacazatte who plays for Arsenal is also considered as one of the best strikers in English premier league. He is the only pure striker in France beside Giroud. Due to his current form and poaching capability, he will be the man playing for<a href="http://wikiceleb.com/france-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener"> France</a> in upcoming FIFA world cup. He has overall 16 international caps with 3 goals. He will be on the list of strikers to be watched for FIFA world cup as <a href="http://wikiceleb.com/france-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">France</a> is big side and also the most watched nation.</p>
8.<strong>Sergio Aguero</strong>

<img class="aligncenter wp-image-603" src="http://wikiceleb.com/wp-content/uploads/2017/12/Sergio-Aguero-300x178.jpg" alt="" width="565" height="335" />

Full Name: Sergio Leonel Kun Aguero

Birth Date: 2<sup>nd</sup> June 1988

Age: 29

Nation: <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a>

Current Club: Manchester City
<p style="text-align: justify;">Sergio Aguero is arguably one of the best strikers in premier league who has scored most goals and record for Manchester city. He is going to be considered as a legend of Manchester city in coming future. Although <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a> will have the likes of Messi, Icardi Aguero is a veteran striker for <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a> and surely have a role for upcoming FIFA world cup. He has 84 international caps for his national side with 36 goals.</p>
9.<strong>Romelu Lukaku</strong>

<img class="aligncenter wp-image-604" src="http://wikiceleb.com/wp-content/uploads/2017/12/lukaku-300x200.jpg" alt="" width="536" height="357" />

Full Name: Romelu Menama Lukaku Bolingoli

Birth Date: 13 May 1993

Age: 24

Nation: <a href="http://wikiceleb.com/belgium-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Belgium</a>

Current Club: Manchester United
<p style="text-align: justify;">The Manchester United striker, Lukaku is the hottest prospect for English premier league this season. Although he failed to shine versus big clubs in the league, he is good poacher and has good goal scoring record for Belgium. With the likes of forwards like Hazard and Mertens, he is surely going to do his job for Belgian reds for upcoming FIFA World Cup.This big man has overall 65 international caps for his national side Belgium with 31 goals. As Belgium has fine attackers, Lukaku will b the striker to be watched for upcoming FIFA world cup.</p>
10.<strong>Radamel Falcao</strong>

<img class="aligncenter wp-image-605" src="http://wikiceleb.com/wp-content/uploads/2017/12/falcao-300x169.jpg" alt="" width="547" height="308" />

&nbsp;

Full Name: Radamel Falcao Garcia Zarate

Birth Date: 10 February 1986

Age: 31

Nation: <a href="http://wikiceleb.com/colombia-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Colombia</a>

Current Club: AS Monaco
<p style="text-align: justify;">Last season French league winner Radamel Falcao who plays for AS Monaco is one of the finest strikers in the French league. He helped his team to win the league and reach up to the semifinal of Champions league last season. He has good goal scoring capacity and also the main man for his national side <a href="http://wikiceleb.com/colombia-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Colombia</a>. He got 65 international caps for <a href="http://wikiceleb.com/colombia-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Colombia</a> with 25 goals. He will also be the top striker to be watched among South American countries for upcoming FIFA world cup.</p>
11.<strong>Andre Silva</strong>

<img class="aligncenter wp-image-607" src="http://wikiceleb.com/wp-content/uploads/2017/12/andre-silva-1-300x190.jpg" alt="" width="547" height="346" />

&nbsp;

&nbsp;

Full Name: Andre Miguel Valente da Silva

Birth Date: 6 November 1995

Age: 22

Nation: <a href="http://wikiceleb.com/portugal-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Portugal</a>

Current Club: AC Milan
<p style="text-align: justify;">Andre Silva was bought by AC Milan last season when they spend their record summer spending. He found his stability in the club within no time and improved massively as a striker. His goal scoring record is also good for AC Milan. Since he is going to play aside Cristiano Ronaldo in upcoming FIFA world cup so he will be a striker to be watched for<a href="http://wikiceleb.com/portugal-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener"> Portugal</a>. He is young but will have great responsibility for his national side. He has 18 international caps with 11 goals.</p>
